import React , {Component} from 'react'
import Child from './Child'

class App extends Component{
    Hello(){
        console.log('Hello');
    }

    render(){
        return(
            <div>
                <Child />
                <button onClick={this.Hello}>Hello</button>
            </div>
        );
    }
}

export default App
